    useEffect(() => {
        console.log("--clinic table update")
        // getAllClinics(setClinics)
    })
    const [clinics, setClinics] = useState([]);

    const [loading, setLoading] = useState(true)

    useLayoutEffect(() => {

        const fetchData=async () => {

